import React, { useState } from 'react';
import Pagination from '@mui/material/Pagination';

function CustomListComp(props) {
    const [page, setPage] = useState(1);
    const [data, setData] = useState(props.data.slice(0, 8));

    const handleChange = (event, value) => {
        setPage(value);
        setData(props.data.slice(8 * (value - 1), 8 * value));
    };

    return (
        <>
            <div className = 'row'>
                { data.slice(0 , 4).map((d, i) => (
                    <div key = { i } className = 'col-md-3'>{ d.firstName }</div>
                )) }
            </div>

            <div className = 'row'>
                { data.slice(3 , 8).map((d, i) => (
                    <div key = { i } className = 'col-md-3'>{ d.firstName }</div>
                )) }
            </div>

            <Pagination
                count={Math.ceil(props.data.length / pageSize)}
                page={page}
                onChange={handleChange}
            />
        </>
    );
}

export default CustomListComp;
